import { PostType } from "../lib/types";
import Link from 'next/link'

export function Post(post: PostType) {
  return (
    <div>
      <h1>
        {post.title}, id - {post.id}
      </h1>
      <h2>
        <Link href={`/${post.id}`}>
          <a>Explore</a>
        </Link>
        </h2>
    </div>
  );
}
